 Resolución N° 09 de fecha 06 de diciembre del 2023, el órgano jurisdiccional RESUELVE DECLARAR CADUCA DE PLENO DERECHO LA MEDIDA CAUTELAR DE NO INNOVAR, en consecuencia CURSESE OFICIO a SUNARP para la inscripción de la declaración de caducidad; en mérito a ello en fecha 20 de diciembre del 2023 se envía escrito CUMPLO PAGO respecto a los aranceles judiciales por partes judiciales; así mismo se puede verificar que en fecha 22 de diciembre del 2023 presenta escrito la otra parte Apelando la Caducidad de la medida cautela',0,'2024-05-01 00:00:00.000',NULL,'{}','2024-05-28 09:45:31.256'),(207,158,'-','-','-','OBLIGACIÓN DE DAR SUMA DE DINERO civil','EXPEDIENTE N°:  \r\nNº 01952-2022-0-1815-JP-CI-07\r\n','Empresa y Comunidades','Sin contrato','Que, mediante la Resolución N°05 de fecha 09 de agosto del 2023, el juzgado PROCEDE A LA REDISTRIBUCIÓN, redistribuido al 1° JUZGADO DE PAZ LETRADO en fecha 15 de agosto del 2023.',0,'2024-05-01 00:00:00.000',NULL,'{}','2024-05-28 09:45:31.256'),(208,158,'-','-','-','OBLIGACIÓN DE DAR SUMA DE DINERO civil','EXPEDIENTE N°:  \r\nNº 01293-2023-0-1507-JP-CO-02\r\n\r\n\r\n','Empresa y Comunidades','Sin contrato','Que, mediante RESOLUCIÓN N° 04 de fecha 05 de enero del 2024, declaran inadmisible el escrito de contradicción, debido a que no se adjuntó aranceles judiciales por ofrecimiento de pruebas y derecho de notificación. En mérito a ello se presenta escrito en fecha 10 de enero del 2024, subsanando dicha omisión y presentando los aranceles judiciales correspondientes',0,'2024-05-01 00:00:00.000',NULL,'{}','2024-05-28 09:45:31.256'),(209,158,'-','-','-','OBLIGACIÓN DE DAR SUMA DE DINERO civil','EXPEDIENTE N°: 00102-2023-0-1833-JP-CI-03','Empresa y Comunidades','Sin contrato','Que, mediante RESOLUCIÓN N° 02 el órgano jurisdiccional RESUELVE ADMITIR a trámite la demanda interpuesta por CONSTRUCCIONES Y EDIFICACIONES ZEUS SAC; en mérito a ello en fecha 30 de noviembre del 2023 se presentó la CONTESTACIÓN DE DEMANDA; es así que, mediante